-- Stored proc to fill in Origine id 
CREATE PROCEDURE [dbo].[sp_SynchroniseConfigSiClientEtSimulation]
AS

Declare @idSource int,
        @idSimule int

Declare curP cursor For  
  select ConfigSiSourceId, ConfigSiSimuleId from BENCHMARK.Simulation

OPEN curP 
Fetch Next From curP Into @idSource, @idSimule

While @@Fetch_Status = 0 Begin
	
	update BENCHMARK.ConfigSiClient set OrigineId = 3 where ConfigSiId=@idSource
	update BENCHMARK.ConfigSiClient set OrigineId = 3 where ConfigSiId=@idSimule
    
Fetch Next From curP Into @idSource, @idSimule

End -- End of Fetch

Close curP
Deallocate curP


-- stored proc 
CREATE PROCEDURE [dbo].[sp_SynchroniseConfigSiClientEtRapport]
AS

Declare @idConfig int

Declare curP cursor For  
  select ConfigSiId from BENCHMARK.Rapport

OPEN curP 
Fetch Next From curP Into @idConfig

While @@Fetch_Status = 0 Begin
	
	update BENCHMARK.ConfigSiClient set OrigineId = 2 where ConfigSiId=@idConfig
    
Fetch Next From curP Into @idConfig

End -- End of Fetch

Close curP
Deallocate curP


